import Col from 'react-bootstrap/esm/Col';

function SearchBar({label}) {
  return (
    // <Col xs= {6}>
      
      <Form inline>
      <FormControl type="text" placeholder={label}/>
      <Button className='btn-secondary'>Search</Button>

      </Form> 
    // </Col> 
 
